// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { CartProvider } from './context/CartContext';
import { AuthProvider, useAuth } from './context/AuthContext';
import Hero from './components/Hero';
import Clubs from './components/Clubs';
import Pricing from './components/Pricing';
import Cafe from './components/Cafe';
import CombinedLayoutBooking from './components/CombinedLayoutBooking';
import BookingConfirmation from './components/BookingConfirmation';
import AdminPanel from './components/AdminPanel';
import MyBookings from './components/MyBookings';
import Login from './components/Login';
import './styles/App.css';

// Защита маршрута для админа
const AdminRoute = ({ children }) => {
  const { user, loading } = useAuth();

  if (loading) return <div>Загрузка...</div>;

  if (!user || user.role !== 'admin') {
    return <Navigate to="/login" replace />;
  }

  return children;
};

// Защита маршрута для обычных пользователей (опционально)
const ProtectedRoute = ({ children }) => {
  const { user, loading } = useAuth();

  if (loading) return <div>Загрузка...</div>;

  if (!user) {
    return <Navigate to="/login" replace />;
  }

  return children;
};

const HomePage = () => {
  return (
    <>
      <Hero />
      <Clubs />
      <Pricing />
      <Cafe />
      <CombinedLayoutBooking />
    </>
  );
};

function AppContent() {
  const { user } = useAuth();

  return (
    <div className="App">
      <Routes>
        <Route path="/login" element={<Login />} />

        {/* Главная доступна всем */}
        <Route path="/" element={<HomePage />} />

        {/* Обычные маршруты — доступны всем, но бронирование может требовать авторизации */}
        <Route path="/booking" element={<CombinedLayoutBooking />} />
        <Route path="/confirmation" element={<BookingConfirmation />} />

        {/* Защищённые маршруты */}
        <Route
          path="/my-bookings"
          element={
            <ProtectedRoute>
              <MyBookings />
            </ProtectedRoute>
          }
        />

        {/* Админка — только для админа */}
        <Route
          path="/admin"
          element={
            <AdminRoute>
              <AdminPanel />
            </AdminRoute>
          }
        />

        {/* Редирект админа после входа */}
        {user?.role === 'admin' && (
          <Route path="*" element={<Navigate to="/admin" replace />} />
        )}
      </Routes>
    </div>
  );
}

function App() {
  return (
    <AuthProvider>
      <CartProvider>
        <Router>
          <AppContent />
        </Router>
      </CartProvider>
    </AuthProvider>
  );
}

export default App;
